column4:
Telefón bol príliš horúci, preto sa vypol, aby vychladol. Teraz funguje ako obvykle.

Telefón sa môže príliš zahriať v týchto prípadoch:
 • používanie náročných aplikácií (napr. hier, videí alebo navigácie);
 • sťahovanie alebo nahrávanie veľkých súborov;
 • používanie telefónu pri vysokých teplotách.

Počas presunu: 
• neodpojujte ^1; 
• niektoré aplikácie nebudú fungovať správne; 
• udržiavajte zariadenie nabité.

